import React from "react";
import Card from './Card';
import web from "../src/images/img2.svg";

const Home = () => {
  return (
    <>
        <Card 
            title = "Grow your business with"
            btn = "Get Started"
            imgsrc = {web}
        />
    </>
  );
};
export default Home;
